import Auth from './components/Auth'
import Homepage from './components/Homepage';
import Detailspage from './components/Detailspage';


function App() {
  const isAuth = useSelector(state => state.auth.isAuthenticated);
  console.log(isAuth)
  return (
    <Fragment>
      <Header />

      {isAuth && (<Homepage/>)}
      {!!isAuth && (<Auth/>)}




    </Fragment>
  );
}

export default App;
